var $bm_rt;
var offset, t;
var fx = effect('TextEvo');
if (fx.active) {
    var v = fx(1);
    var delay = fx(2);
    var sens = parseInt(fx(3));
    var demi = Math.ceil($bm_div(textTotal, 2));
    var fromIndex = fx(4);
    seedRandom($bm_sum(textIndex, fx(5)), true);
    switch (sens) {
    case 1:
        offset = $bm_mul($bm_mul($bm_sub(textIndex, 1), thisComp.frameDuration), delay);
        break;
    case 2:
        offset = $bm_mul($bm_mul($bm_sub(textTotal, textIndex), thisComp.frameDuration), delay);
        break;
    case 3:
        if (textTotal & 1) {
            if (textIndex == demi) {
                offset = 0;
            } else if (textIndex < demi) {
                offset = $bm_mul($bm_mul($bm_sum($bm_sub($bm_sub(textTotal, textIndex), demi), 1), thisComp.frameDuration), delay);
            } else {
                offset = $bm_mul($bm_mul($bm_sub(textIndex, demi), thisComp.frameDuration), delay);
            }
        } else {
            if (textIndex == demi || textIndex == demi + 1) {
                offset = 0;
            } else if (textIndex < demi) {
                offset = $bm_mul($bm_mul($bm_sub($bm_sub(textTotal, textIndex), demi), thisComp.frameDuration), delay);
            } else {
                offset = $bm_mul($bm_mul($bm_sub($bm_sub(textIndex, demi), 1), thisComp.frameDuration), delay);
            }
        }
        break;
    case 4:
        if (textIndex <= $bm_div(textTotal, 2)) {
            offset = $bm_mul($bm_mul($bm_sub(textIndex, 1), thisComp.frameDuration), delay);
        } else {
            offset = $bm_mul($bm_mul($bm_sub(textTotal, textIndex), thisComp.frameDuration), delay);
        }
        break;
    case 5:
        offset = $bm_mul(thisComp.frameDuration, random($bm_mul(delay, textTotal)));
        break;
    case 6:
        if (textIndex == fromIndex) {
            offset = 0;
        } else if (textIndex < fromIndex) {
            offset = $bm_mul($bm_mul($bm_sub(fromIndex, textIndex), thisComp.frameDuration), delay);
        } else {
            offset = $bm_mul($bm_mul($bm_sub(textIndex, fromIndex), thisComp.frameDuration), delay);
        }
        break;
    }
    t = $bm_sub(time, offset);
    $bm_rt = v.valueAtTime(t);
} else {
    $bm_rt = 0;
}

